<template>
  <div>
    <br>
    <button v-on:click="prevImg()"> Prev Image </button>
    <button @click="nextImg()"> Next Image </button>
    <br>
    <!-- <img :src="imgLink[imgIndex]" alt="" width="300"> -->
    <div v-for="img in imgLink" :key="img">
      <img :src="img" alt="">
    </div>
  </div>
</template>

<script>
export default {
  data () {
    return {
      imgLink: [
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'https://f.ptcdn.info/574/058/000/pbpd0o63a458dunKys3-o.jpg',
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWhG2VvtPd_0EkpKv_Jf0q7n3E1l_sHdm_RyvvvEySFyR-r-mDlA'
      ],
      imgIndex: 0
    }
  },
  methods: {
    nextImg() {
      this.imgIndex++
      if (this.imgIndex >= this.imgLink.length) {
        this.imgIndex = 0
      }
    },
    prevImg() {
      this.imgIndex--
      if (this.imgIndex < 0) {
        this.imgIndex = this.imgLink.length - 1
      }
    }
  }
}
</script>